### GET /admin/users

This endpoint retrieves a list of users with pagination support.

#### Request

- Method: GET

- URL: {{base_url}}/admin/users

- Query Parameters:

    - page (number, required): The page number for pagination.

    - limit (number, required): The maximum number of users to retrieve per page.


#### Response

The response is in JSON format and follows the schema below:

``` json
{
  "type": "object",
  "properties": {
    "data": {
      "type": "object",
      "properties": {
        "users": {
          "type": "array",
          "items": {
            "type": "object",
            "properties": {
              "name": { "type": "string" },
              "email": { "type": "string" },
              "mobile": { "type": "string" },
              "banned": { "type": "boolean" },
              "badges": { "type": "array" },
              "createdAt": { "type": "string" },
              "updatedAt": { "type": "string" },
              "membershipTier": { "type": "string" },
              "id": { "type": "string" }
            }
          }
        },
        "meta": {
          "type": "object",
          "properties": {
            "totalCount": { "type": "number" },
            "limit": { "type": "number" },
            "totalPages": { "type": "number" },
            "currentPage": { "type": "number" },
            "hasPrevPage": { "type": "boolean" },
            "hasNextPage": { "type": "boolean" },
            "prevPage": { "type": ["number", "null"] },
            "nextPage": { "type": ["number", "null"] }
          }
        }
      }
    }
  }
}

 ```

